import React from 'react'
import { BrowserRouter, Routes, Route, useLocation } from "react-router-dom";
import NavPrincipal from './componentes/NavBar'
import Home from './pages/Home/Home';
import './App.css'

function App() {
  return (
    <div>
        <NavPrincipal />
        <Routes>
          <Route path="/" element={<Home />} />
        </Routes> *
    </div>
  )
}

export default App
